const { __ } = wp.i18n;
const { registerBlockType } = wp.blocks;
const { RichText, InnerBlocks,InspectorControls } = wp.blockEditor;

const {
  PanelBody,
  PanelRow,
  RangeControl
} = wp.components;

registerBlockType("gb/gridwithlargeroundimages", {
  title: __("Grid With Large Round Images", "GB"),
  icon: (
    <img src="data:image/jpeg;base64," />
  ),
  category: "team",
  attributes: {
    columns: { type: "number", default: 6 },
    contentUB: { type: "string", default: `Meet our team` },
    contentUA: {
      type: "string",
      default: `Ornare sagittis, suspendisse in hendrerit quis. Sed dui aliquet lectus sit pretium egestas vel mattis neque.`,
    }
  },
  edit: function (props) {
    const { attributes, setAttributes } = props;


    const onChangeColumns = (newColumns) => {
        setAttributes({ columns: newColumns });
    };

    const template = Array.from(Array(attributes.columns).keys()).map((i) => [
      "gb/teammember",
    ]);

    const allowedBlocks = ["gb/teammember"];


    return (
      <div className="bg-white">
        <InspectorControls>
          <PanelBody title="Block settings">
            <PanelRow>
              <b>Team members</b>
            </PanelRow>
            <PanelRow>
              <RangeControl
                  label="Columns"
                  value={attributes.columns}
                  onChange={(value) => onChangeColumns(value)}
                  min={1}
                  max={30}
              />
            </PanelRow>
          </PanelBody>
        </InspectorControls>
        <div className="max-w-7xl mx-auto py-12 px-4 text-center sm:px-6 lg:px-8 lg:py-24">
          
          <div className="space-y-12">
            
            <div className="space-y-5 sm:mx-auto sm:max-w-xl sm:space-y-4 lg:max-w-5xl">
              
              <h2 className="text-3xl font-extrabold tracking-tight sm:text-4xl">
                <RichText
                  value={attributes.contentUB}
                  default={"Meet our team"}
                  onChange={(newtext) =>
                    setAttributes({ contentUB: newtext })
                  }
                />
              </h2>
              <p className="text-xl text-gray-500">
                <RichText
                  value={attributes.contentUA}
                  default={
                    "Ornare sagittis, suspendisse in hendrerit quis. Sed dui aliquet lectus sit pretium egestas vel mattis neque."
                  }
                  onChange={(newtext) =>
                    setAttributes({ contentUA: newtext })
                  }
                />
              </p>
            </div>
            <div className="gridwithlargeimages-list">
    
                <InnerBlocks
                    template={template}
                    templateLock="all"
                    allowedBlocks={allowedBlocks}
                />
            </div>
          </div>
        </div>
      </div>
    );
  },
  save: function (props) {
    const { attributes } = props;


    return (
      <div class="bg-white">
        
        <div class="max-w-7xl mx-auto py-12 px-4 text-center sm:px-6 lg:px-8 lg:py-24">
          
          <div class="space-y-12">
            
            <div class="space-y-5 sm:mx-auto sm:max-w-xl sm:space-y-4 lg:max-w-5xl">
              
              <h2 class="text-3xl font-extrabold tracking-tight sm:text-4xl">
               <RichText.Content value={attributes.contentUB}/>
              </h2>
              <p class="text-xl text-gray-500">{attributes.contentUA} </p>
            </div>
            <div
              role="list"
              class="mx-auto space-y-16 sm:grid sm:grid-cols-2 sm:gap-16 sm:space-y-0 lg:grid-cols-3 lg:max-w-5xl"
            >
              <InnerBlocks.Content />
            </div>
          </div>
        </div>
      </div>
    );
  },
});
